import{_ as e,c as i,o as s,aj as o}from"./chunks/framework.VtnL2jmu.js";const b=JSON.parse('{"title":"打包的jar启动报错问题","description":"","frontmatter":{"permalink":"/springboot/5"},"headers":[],"relativePath":"springboot/打包的jar启动报错问题.md","filePath":"springboot/打包的jar启动报错问题.md"}'),n={name:"springboot/打包的jar启动报错问题.md"};function t(c,a,r,l,p,d){return s(),i("div",null,[...a[0]||(a[0]=[o(`<h1 id="打包的jar启动报错问题" tabindex="-1">打包的jar启动报错问题 <a class="header-anchor" href="#打包的jar启动报错问题" aria-label="Permalink to “打包的jar启动报错问题”">​</a></h1><p>使用 <code>jar -jar</code> 启动 Spring Boot 应用时，可以通过在命令行中添加 <code>--server.port</code> 参数来指定端口号</p><p>报错：</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark" style="--shiki-light:#24292e;--shiki-dark:#e1e4e8;--shiki-light-bg:#fff;--shiki-dark-bg:#24292e;" tabindex="0" dir="ltr"><code><span class="line"><span>Caused by: java.lang.ExceptionInInitializerError: Exception java.lang.reflect.InaccessibleObjectException: Unable to make field private final java.lang.Class java.lang.invoke.SerializedLambda.capturingClass accessible: module java.base does not &quot;opens java.lang.invoke&quot; to unnamed module @71c7db30 [in thread &quot;http-nio-8081-exec-1&quot;]</span></span></code></pre></div><p>这个错误通常出现在 Java 9 及以上版本中的模块化环境下。<code>java.lang.reflect.InaccessibleObjectException</code> 表示在尝试访问私有字段时出现了访问限制的问题。</p><p>在 Java 9 中引入了模块系统，为了提高安全性和封装性，Java 核心模块的一些包（如 <code>java.lang</code> 包下的一些类）进行了限制，防止未经授权的模块直接访问它们的内部。</p><p>在你的情况下，出现 <code>InaccessibleObjectException</code> 可能是因为某个模块（可能是你的应用程序）试图访问了受限制的 <code>java.lang.invoke.SerializedLambda</code> 类的私有字段。</p><p>解决这个问题的一种方法是在启动 JVM 时添加参数来打开 <code>java.lang.invoke</code> 包的访问权限。可以尝试在启动命令中添加 <code>--add-opens</code> 参数来允许该访问权限：</p><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark" style="--shiki-light:#24292e;--shiki-dark:#e1e4e8;--shiki-light-bg:#fff;--shiki-dark-bg:#24292e;" tabindex="0" dir="ltr"><code><span class="line"><span>bash</span></span>
<span class="line"><span>java --add-opens java.base/java.lang.invoke=ALL-UNNAMED -jar your-application.jar</span></span></code></pre></div><p>这里 <code>your-application.jar</code> 是你的 Spring Boot 应用程序的名称。这个参数会将 <code>java.lang.invoke</code> 包中的内容开放给未命名的模块，允许访问其中的私有字段。请注意，这是一种权宜之计，有时可能会在特定环境中有效，但不是永久性的解决方案。</p>`,10)])])}const h=e(n,[["render",t]]);export{b as __pageData,h as default};
